import React from 'react'
import './DropDown.css'

import NavigateNextIcon from '@material-ui/icons/NavigateNext';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';

function DropDown(props) {
    return (
        <div className='dropDownRoot'>

            <input type='checkbox' id={props.menuName + props.ckeckboxID} />

            <div className='aTagAndIcon'>
                <a href={props.href} style={props.style}>
                    <span>{props.menuName}</span>
                </a>
                <label className='iconWrapper' for={props.menuName + props.ckeckboxID}>
                    <ExpandMoreIcon style={{ color: 'rgb(0,0,0)', fontSize: "25px" }} />
                </label>
            </div>

            <div className='menuContent'>
                {props.children}
            </div>
        </div>
    )
}

export default DropDown
